import bg from '../assets/bg.png';

import G from '../assets/G.png';

import logo from '../assets/logo.png';
import menu from '../assets/menu.png';
import overlaybg from '../assets/overlaybg.png';
import spoon from '../assets/spoon.svg';
import welcome from '../assets/welcome.jpeg';
import findus from '../assets/findus.png';
import quote from '../assets/quote.png';

import himachali_thali from '../assets/himachali_thali.jpeg';
import rajasthani_thali from '../assets/rajasthani_thali.jpeg';
import punjabi_thali from '../assets/punjabi_thali.jpeg';
import menu_1 from '../assets/menu_1.jpeg';

export default {
  bg,
  G,
  logo,
  menu,
  overlaybg,
  spoon,
  welcome,
  findus,
  quote,

  himachali_thali,
  rajasthani_thali,
  punjabi_thali,
  menu_1
};
